Input = Input[0].split("\n")

PlaceholderMap = []
#Expand heightwise
for Row in Input:
  DoubleIt = True
  for x in range(len(Row)):
    if Row[x] == "#":
      DoubleIt = False
  if DoubleIt:
    PlaceholderMap.append(Row)
  PlaceholderMap.append(Row)

#Expand widthwise
NewMap = []
DoubledColumns = []
for Column in range(len(PlaceholderMap[0])):
  DoubleIt = True
  for x in range(len(PlaceholderMap)):
    if PlaceholderMap[x][Column] == "#":
      DoubleIt = False
  if DoubleIt:
    DoubledColumns.append(Column)

print(DoubledColumns)

for Row in PlaceholderMap:
  Adder = -1
  for DoubleThis in DoubledColumns:
    Adder += 1
    Row = Row[:DoubleThis + Adder] + "." + Row[DoubleThis + Adder:]
  NewMap.append(Row)
  print(Row)

Galaxies = []
for Row in range(len(NewMap)):
  for Column in range(len(NewMap[0])):
    if NewMap[Row][Column] == "#":
      Galaxies.append([Row, Column])
print(Galaxies)

Total = 0
for GalaxyIndex in range(len(Galaxies)):
  for SecondaryGalaxyIndex in range(GalaxyIndex, len(Galaxies)):
    PathLength = 0
    PathLength = PathLength + abs(Galaxies[GalaxyIndex][0] - Galaxies[SecondaryGalaxyIndex][0])
    PathLength = PathLength + abs(Galaxies[GalaxyIndex][1] - Galaxies[SecondaryGalaxyIndex][1])
    Total += PathLength
    print(Total, PathLength)